$(document).ready(function(){$("#dataInicio").datepicker(formatoData);$("#dataFim").datepicker(formatoData);$("#formTipo").change(a);var c=$("#formSaidaItens");$("#botaoExpandirGerarPdf").click(function(){if(!b()){c.attr("target","_blank");c.attr("action",baseUrlPdf);c.submit()}});$("#botaoExpandirPesquisar").click(function(){if(!b()){c.attr("target","_self");c.attr("action",baseUrlExpandir);c.submit()}});$("#botaoListaExpandir").click(function(){if(!b()){c.attr("target","_blank");c.attr("action",baseUrlExpandir);c.submit()}});$("#botaoListaPesquisar").click(function(){if(!b()){c.attr("target","_self");c.attr("action",baseUrlLista);c.submit()}});function a(){$("#formItem").html('<option value="0">Todos os Itens</option>');for(i in itens){if(itens.hasOwnProperty(i)&&itens[i]["id_tipo"]==$("#formTipo option:selected").val()){$("#formItem").append('<option value="'+itens[i]["id_item"]+'">'+itens[i]["nome"]+"</option>")}}}function b(){var d=false;if($("#formDataInicio").val()==""){d=true;notificacao_erro("<h5>Escolha uma <b>Data de Início.</b></h5>")}else{if($("#formDataFim").val()==""){d=true;notificacao_erro("<h5>Escolha uma <b>Data de Fim.</b></h5>")}else{if(pegaData($("#formDataInicio").val())>pegaData($("#formDataFim").val())){d=true;notificacao_erro("A <b>Data Início</b> não pode ser maior que a <b>Data Fim</b>.")}else{if(pegaData($("#formDataFim").val())>new Date()){d=true;notificacao_alerta("A <b>Data Fim</b> não pode ser maior que a data atual.")}}}}return d}});